import logo from "./logo.svg";
import "./App.css";
import Login from './components/login'
import Test from './components/Nav'
import {Route, Link} from 'react-router-dom'

function App() {
return (
	<div className="App">
        <h1>test</h1>
        <Route exact to="/" component={Login} />
        <Route exact to="/test" component={Test} />
        <h1>test</h1>
    </div>
);
}


export default App;
